import React from "react"
import { Redirect } from 'react-router';


class RedirectRoute extends React.Component{
    constructor(props){
        super(props)
    }
    render(){
        console.log(this.props.path);
        return(
            <Redirect push to={this.props.path} />
        )
    }
}

export default RedirectRoute;
